import React, { useEffect, useState } from "react";

export default function List(props) {
  let final = {};

  return (
    <div>
      {props.arr.map((i) => (
        <div key={i?.id} >
          <h4
            style={{ display: "block" }}
            onClick={() => {
              final = i;
              props.details(final);
            }}
          >
            {i?.recipeName}
            <span
              style={{ marginLeft: "50px" }}
              onClick={() => {
                props.deleteObject(i?.id);
              }}
            >
              X
            </span>
            <button
              style={{ marginLeft: "50px" }}
              onClick={() => {
                props.editable(i?.id);
              }}
            >
              Edit
            </button>
          </h4>
        </div>
      ))}
    </div>
  );
}
